CoWIN का कोई बहुत बड़ा प्रशंसक नहीं हूं लेकिन क्यूआर कोड का इस्तमाल करके प्रमाणपत्रों को आसानी से सत्यापित किया जा सकता है।

यह इसीलिए भी विचित्र है क्योंकि यही ब्रिटेन अमेरिका के हस्तलिखित वैक्सीन प्रमाणपत्रों पर भी भरोसा कर रहा है।

